/*
원시 타입 nuber, string, boolean, null, undefined
*/
// 전부 숫자 number type
let num1 = 10;
let num2 = NaN;
let num3 = -123;
let num4 = 0.123456;
let num5 = Infinity;
num1 = 100;
/* string type */
let str1 = 'hi';
let str2 = 'hi ㅋㅋ';
let str3 = `hi  ${num2}`;
/* boolean type */
let bool1 = true;
let bool2 = false;
/* null type */
let nullA = null;
nullA = null;
/* undefined type */
let undef = undefined;
/* literal type */
// "어떠한 값"을 literal라 하였다.
// 값을 강제로 넣어줄 수 있다.
let numA = 10;
let strA = 'hello';
let boolA = true;
// unknown type
// 해당 값을 현재는 모르고 나중에 값을 너어줄 예정일 때 사용한다
let unknown;
/* never type */
let never;
/* any type */
let any;
export {};
